edition = "2023";

package youtube.api.innertube;

import "youtube/api/innertube/foreground_heartbeat_trigger.proto";
import "youtube/api/innertube/foreground_heartbeat.proto";

option java_package = "com.google.protos.youtube.api.innertube";
option java_multiple_files = true;
option cc_enable_arenas = true;
option objc_class_prefix = "YTI";

message DummyPayload {
	bool in_experiment = 1;
	int32 request_id = 2;
	ForegroundHeartbeatTrigger trigger = 3;
	int32 des_v2_key = 4;
	ForegroundHeartbeat foreground_heartbeat = 6;
}
